Always on the hunt to find the best plantain chips 🌟 

Solula tostones are our new snacking addiction... These plantain chips are SERIOUSLY good! They have three tasty varieties: Pacific Sea Salt, Roasted Garlic, and Caribbean Lime. They are unbelievably delicious and crunchy! Each bite is an irresistible “wow” experience.

@enjoysolula tostones are picked, fried, and packed within 48 hours for maximum freshness and deliciousness! Solula partners with local plantain growers in Ecuador and Guatemala to source fresh green plantains for tostones made from a traditional family recipe that’s been passed along for generations.

